import React, { useState, useEffect } from 'react';
import LoadingIndicator from './components/loading-indicators/loading-indicator';
import AnimatedPulseCoffeeIcon from './components/animated-icons/animated-pulse-coffee-icon';

const App = () => {
  const [isLoading, setIsLoading] = useState(true);

  useEffect(() => {
    setTimeout(() => {
      setIsLoading(false);
    }, 3000);
  }, []);

  return (
    <body className="cv-wrapper">
      <AnimatedPulseCoffeeIcon />
    </body>
  );
};

export default App;
